[DPFanatics] Sabrina Moore (A Proper Introduction / 6415 / 11.23.2014)

Sabrina is a seductive vixen, even on her workplace. The office is her hunting ground and she bends the guys around her finger whenever she wants to. Today she flirts with one of them and things get a bit out of hand. Especially, when another of her colleagues steps into the room. The result? Check it out for yourself!


